import React from "react";
import { useLocation } from "react-router-dom";
import { ContactUs } from "../components/ContactUs";

export default function ContactScreen() {
  const location = useLocation();
  const info = location.state?.info;

  const nonInfo = "General";

  return (
    <div className='contact-holder'>
      <h1>Contact me!</h1>
      <div className='logo-holder'>
        <a href='https://www.twitter.com/' rel='noreferrer' target='_blank'>
          <img src='../images/twitter.png' alt='Twitter Logo'></img>
        </a>
        <a href='https://www.instagram.com/' rel='noreferrer' target='_blank'>
          <img src='../images/instagram.png' alt='Instagram Logo'></img>
        </a>
        <a href='https://www.facebook.com/' rel='noreferrer' target='_blank'>
          <img src='../images/facebook.png' alt='Facebook Logo'></img>
        </a>
        <a href='https://www.linkedin.com/' rel='noreferrer' target='_blank'>
          <img src='./images/linkedin.png' alt='LinkedIn Logo'></img>
        </a>
      </div>
      <div className='contact-js-holder'>
        {info ? <ContactUs session={info} /> : <ContactUs session={nonInfo} />}
      </div>
    </div>
  );
}
